    return (
        <div>
            <h1>{props.name} {hero}</h1>
            <ul>
                {hero.map((dish) => (<li key={dish.id}>
                    {dish.dish.productName}
                </li>))}
            </ul>

            {/* <button onClick={Hero}>staeChange</button> */}
        </div>
    );
}

